import styled from 'styled-components';

export const Container = styled.nav`
    padding: 0 5rem;
    display: flex;
    align-items: center;
    flex-wrap: wrap;
    div{
      display: flex;
      justify-content: space-between;
      align-items: center;
      position: relative;
    }
    a{
      padding: 1rem 2rem;
      text-align: center;
      font: normal normal medium 3rem;
      font-weight: 600;
      letter-spacing: 0px;
      color: #071242;
      opacity: 1;
      text-decoration: none;
      cursor: pointer;

    };
`
